        <img alt={props.plantName} src={props.image} />
      </div>
      <div className="content">
        <p> {props.plantName}</p>
        <p>{props.price}</p>
        {/* <p>{props.stock}</p>  */}
        <Payment
          key={props._id}
          image={props.image}
          plantName={props.plantName}
          price={plants.price}
        />
      </div>
    </div>
  );
};

export default PlantCard;
